import Navbar from './Components/Navbar';
import Homepage from './Components/Homepage';
import Moves from './Components/Moves';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Navbar/>
      <Homepage/>
      <Moves/>
      <Footer/>
    </div>

  );
}

export default App;
